import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
      {props.person.name}<br/>
      {props.person.birthday}<br/>
      {props.person.favoriteFoods.meats.map(e => <p key={e}>{e}</p>)}<br/>
      {props.person.favoriteFoods.fish.map(e => <p key={e}>{e}</p>)}<br/>
    </div>
  )
}

export default Card
